import { NavLink } from "react-router-dom"

const customLink = (to,children) => {
return(
  <li>
    <NavLink to={to} style={isActive => ({textDecoration: isActive ? "underline" : "none"})}>
      {children}
    </NavLink>
  </li>
)
}

export {customLink};
